(166, 1, '2014-10-24 12:58:41', '2014-10-24 09:58:41', '<p>Nimi (pakollinen)<br />\r\n    [text* your-name class:form-control] </p>\r\n\r\n<p>Sähköposti (pakollinen)<br />\r\n    [email* your-email class:form-control] </p>\r\n\r\n<p>Aihe<br />\r\n    [text your-subject class:form-control] </p>\r\n\r\n<p>Viesti<br />\r\n    [textarea your-message class:form-control] </p>\r\n\r\n<p>[submit "Lähetä"]</p>\n[your-subject]\n[your-name] <Rishadan_Drow@yahoo.com>\nLähettäjä: [your-name] <[your-email]>\r\nAihe: [your-subject]\r\n\r\nViesti: \r\n[your-message]\r\n\r\n--\r\nTämä viesti on lähetetty palautelomakkeella PEEVEEBAR (http://localhost/peevee_istand)\nRishadan_Drow@yahoo.com\nReply-To: [your-email]\n\n\n\n\n[your-subject]\nPEEVEEBAR <Rishadan_Drow@yahoo.com>\nViesti: \r\n[your-message]\r\n\r\n--\r\nTämä viesti on lähetetty palautelomakkeella PEEVEEBAR (http://localhost/peevee_istand)\n[your-email]\nReply-To: Rishadan_Drow@yahoo.com\n\n\n\nViesti lähetettiin onnistuneesti. Kiitos yhteydenotostanne!\nViestin lähetys epäonnistui. Yritä myöhemmin uudestaan tai ota yhteyttä järjestelmänvalvojaan toisella tavalla.\nLomakkeesta löytyi virheitä. Tarkasta lomake ja yritä uudelleen.\nViestin lähetys epäonnistui. Yritä myöhemmin uudestaan tai ota yhteyttä järjestelmänvalvojaan toisella tavalla.\nHyväksy käyttöehdot jatkaaksesi.\nTäytä pakollinen kenttä.\nSyöttämäsi koodi on virheellinen.\nNumeron muoto vaikuttaa virheelliseltä.\nLuku on liian pieni.\nLuku on liian suuri.\nSähköpostiosoite vaikuttaa virheelliseltä.\nURL-osoite vaikuttaa virheelliseltä.\nPuhelinnumero vaikuttaa virheelliseltä.\nVastauksesi on väärä\nPäivämäärän muoto vaikuttaa virheelliseltä.\nPäivämäärä on liian aikainen.\nPäivämäärä on liian myöhäinen.\nTiedoston lataaminen epäonnistui.\nTiedostotyyppi ei ole sallittu.\nTiedosto on liian suuri\nTiedoston lataaminen epäonnistui. Virhe.', 'Yhteydenottolomake 1', '', 'publish', 'open', 'open', '', 'yhteydenottolomake-1', '', '', '2014-10-24 13:02:49', '2014-10-24 1